/*function Info(props) {  return <h1>Hello i'm {props.name}</h1>; } Info.defaultProps = { name: "unkown" }; */
import React from "react";
class Info extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return this.props;
  }
}
export { Info };
